import React from 'react';
import { useParams } from 'react-router';

const TeamDetail = () => {
    let { idTeam } = useParams();
    return (
        <div>
            <h1>This is TeamDetail{idTeam}</h1>
        </div>
    );
};

export default TeamDetail;
